MGCAddSnippet(1, "Title Page");
MGCAddSnippet(2, "List of Figures");
MGCAddSnippet(3, "List of Tables");
MGCAddSnippet(4, "");
MGCAddSnippet(5, "Calibre Litho-Friendly Design (Calibre LFD) is introduced with an overview of the concepts and workflow, followed by the modes of operation, and the rules and syntax conventions related to using this product.");
MGCAddSnippet(6, "Calibre LFD is a pre-tapeout verification engine designed to help characterize sensitivity of designs to process variability. ");
MGCAddSnippet(7, "Lithographers and Computer Aided Designers (CAD) use Calibre LFD software to design process-specific Calibre LFD kits. Designers use Calibre LFD software with these LFD kits to check and improve their designs with respect to manufacturability. The process-specific kits serve as a bridge between lithographers and designers.");
MGCAddSnippet(8, "Several requirements must be met in order to run Calibre LFD. ");
MGCAddSnippet(9, "Litho-Friendly Design software is executed by the Calibre hierarchical engine. You can invoke run Calibre LFD from Calibre Interactive DFM or from the command line.");
MGCAddSnippet(10, "When you run Calibre LFD from Calibre Interactive you can export the design from a connected layout design tool. You can also use the GUI to set run options and override settings in the rule file. ");
MGCAddSnippet(11, "Command line options specify the processing mode. ");
MGCAddSnippet(12, "You can run Calibre LFD from the command line. ");
MGCAddSnippet(13, "The -mbh switch runs Calibre LFD with model-based hints (MBH) functionality. This optional Calibre LFD feature generates a hints file for fixing lithographic hotspots. The designer can use the hint information as a repair reference.");
MGCAddSnippet(14, "Calibre LFD supports the use of CPUs with AVX x86 instruction set architecture, which can improve the runtime performance of Calibre LFD RET applications.");
MGCAddSnippet(15, "Encryption allows the foundry to give you access to sensitive data without disclosing any proprietary information. This is true for both standard design kits and process-specific Calibre LFD design kits. Running Calibre LFD with an encrypted rule file does not require any special licenses or commands. Encrypted rule files begin with header text containing a legal disclaimer and a reference to the version of Calibre used to verify the rule file. Below the header, you see both encrypted and unencrypted code. Encrypted code begins with #DECRYPT and ends with #ENDCRYPT.");
MGCAddSnippet(16, "The command descriptions use font properties and several metacharacters to document the command syntax.");
MGCAddSnippet(17, "Calibre LFD is a pre-tapeout verification engine designed to help design teams cope with the increasing sensitivity of designs to process variability. Several key concepts are important to understand when adding Calibre LFD to your design flow.");
MGCAddSnippet(18, "As process nodes shrink, the sensitivity to variability increases. Slight changes to dose, focus, or mask bias lead to fluctuations in properties such as delay and leakage.");
MGCAddSnippet(19, "At each stage in the design process, metrics provide insight into how process variation impacts design manufacturability. ");
MGCAddSnippet(20, "Calibre LFD characterizes design specific process variation and provides information that is context and performance relevant.");
MGCAddSnippet(21, "Calibre LFD checks look at the interrelationships between PV-bands or between PV-bands and target features. ");
MGCAddSnippet(22, "Calibre LFD metrics based on PV-band data return scores and other properties for the design, process, and type of error. Layout designers can use these metrics to guide them as they choose which problem areas to address first and how to make trade-off decisions.");
MGCAddSnippet(23, "Calibre LFD can range from a simple yes/no design rule in which an error must be fixed, to a more gradual analysis of the printability of a given layout. For this reason, Calibre LFD provides several methods to define the priorities of checks, establish rankings, and manage trade-offs to adapt to the desired mode of operation. Modes of operation can be required rules, recommended rules, or analysis.");
MGCAddSnippet(24, "The DRC-based approach to modeling process requirements is not sufficient to account for the effects of process window and device variations. This is due to design rules not modeling the sensitivity of a lithographic process window to the actual features being printed, or to the effect of the sensitivity on semiconductor chip yield. ");
MGCAddSnippet(25, "Calibre LFD rules and models evolve with your process. You create your preliminary process-specific Calibre LFD design kit (rules, models, and RET recipe) based on knowledge of similar processes and existing equipment. As the process matures, you update the Calibre LFD rules to reflect the current level of understanding. ");
MGCAddSnippet(26, "Calibre LFD works by giving designers access to information previously available only to lithographers working in the fabrication facility. Due to this, setting up a Calibre LFD process at your site involves the Litho, CAD, and Design teams.");
MGCAddSnippet(27, "The lithographer s role in implementing the Calibre Litho-Friendly Design (Calibre LFD) flow is to design process variation experiments and develop the rules identifying potential failure spots. The following topics describe what is needed from the lithography team and in what format.");
MGCAddSnippet(28, "You must have a layout database, a basic rule file, an optical model, and a resist model in order to write Calibre LFD rules. ");
MGCAddSnippet(29, "Some background information about PV-bands, process variability, and the Calibre LFD flow is useful before starting to write Calibre LFD rules. ");
MGCAddSnippet(30, "A PV-band is a geometry that shows how edge locations respond to process variations. It represents the area within which a feature prints as the process conditions vary. Generating PV-bands involves simulating the printed image at the various process conditions and combining the resulting printed images. PV-bands have widths due to process variation.");
MGCAddSnippet(31, "The Calibre LFD tool generates regular and absolute PV-bands.");
MGCAddSnippet(32, "Using PV-bands to identify potential problems and predict how well a design prints involves several steps.");
MGCAddSnippet(33, "Each PV-band represents all possible printing locations resulting from one set of dose, focus, mask bias, resist, and etch variation conditions. That set of exposure conditions is referred to as a process variation experiment.");
MGCAddSnippet(34, "Generating process-specific Calibre LFD kits for design verification is a cooperative effort involving lithographers and rule writers. Depending on the size of your organization, this will be one team or two, one person or many. For simplicity, the assumption is that there are two separate teams: the litho team and the CAD team. ");
MGCAddSnippet(35, "In generating PV-band data, you define the process variations to explore by specifying a set of dose, focus, mask bias, resist, and etch variation settings relative to optimal values. ");
MGCAddSnippet(36, "An optical model is a set of functions for creating a numerical approximation of the image behavior. Optical modeling requires a parameter file containing all parameters needed for creating an optical model.");
MGCAddSnippet(37, "Calibre RVE is a graphical debug program that interfaces with most IC layout tools. You can view the PV-band data using Calibre RVE in conjunction with the layout viewer.");
MGCAddSnippet(38, "The topology of a PV-band can predict the type of failure. ");
MGCAddSnippet(39, "The built-in check functions provide a quick way to check for the PV-band configurations most commonly considered to be problematic. ");
MGCAddSnippet(40, "Designing custom checks involves describing problem situations in terms of properties or relationships between original or derived layers. For best results, provide the rule writer you are working with verbal, mathematical, and graphical descriptions of the problem and the solution.");
MGCAddSnippet(41, "Metrics to help the designer prioritize and understand the need for corrections.");
MGCAddSnippet(42, "The Calibre LFD software package provides two metrics, Design Variability Index (DVI) and Process Variability Index (PVI).");
MGCAddSnippet(43, "Designing custom metrics involves calculating a score based on statistics for one or more layers. Using a pre-defined set of statistics and operations, you define the equation to use to calculate the score. ");
MGCAddSnippet(44, "Ranking errors allows you to sort through checks and errors to simplify studying the design and planning modifications.");
MGCAddSnippet(45, "When you run Calibre LFD checks using a single process variation experiment, all you can really tell from the checks results is whether or not a feature is susceptible to printing problems at one or more process conditions tested in the experiment. If you run multiple experiments, each testing a different set of dose, focus and other variability conditions, you can rank the Calibre LFD results according how likely it is for an error to occur.");
MGCAddSnippet(46, "For a more granular ranking than provided by the built-in ranking, you can define your own user-defined ranking system and assign each check a different priority using the -priority keyword. When you specify a custom ranking, the system writes that value directly to the results database. Experiment and check ranking is ignored.");
MGCAddSnippet(47, "Error markers contain properties, and you can export these markers. ");
MGCAddSnippet(48, "The Computer Aided Designers (CAD) group s role in implementing the Litho-Friendly Design flow is to write the process-specific Calibre LFD kits designers use to analyze a design using Calibre LFD rules. The following topics describe how to create process-specific Calibre LFD kits:");
MGCAddSnippet(49, "A process-specific Calibre LFD kit is the set of rule files and models required for applying Calibre LFD practices to a specific design. ");
MGCAddSnippet(50, "Rule files for performing Calibre LFD work must accomplish several tasks.");
MGCAddSnippet(51, "The Tcl Verification Format (TVF) is a programmable expansion to the Standard Verification Rule Format (SVRF) language for Calibre. The rule files used to run Calibre LFD must be written using TVF. ");
MGCAddSnippet(52, "A rule file written using SVRF can use special pre-processor directives such as #DEFINE and #IFDEF to control processing based on user-defined variables. You can use Tcl variables and constructs to perform the same functions in a TVF rule file. ");
MGCAddSnippet(53, "Rule files used for performing Calibre LFD incorporate the RET recipes for one or more layers. Each recipe requires its own models, setup file, and SVRF rules. Before including or embedding these files, make sure all layer names and variable names are unique.");
MGCAddSnippet(54, "It is important to avoid namespace collisions in Tcl programming. ");
MGCAddSnippet(55, "To ensure the Calibre LFD functions are processed correctly, add the prefix  LFD::  to every function call. ");
MGCAddSnippet(56, "There are several TVF commands for accessing variables in the rule file and command line arguments.");
MGCAddSnippet(57, "You can echo the SVRF commands created from translating the TVF rule file. ");
MGCAddSnippet(58, "You gain access to Calibre LFD functionality by loading the Calibre LFD package. ");
MGCAddSnippet(59, "The Calibre LFD block is the portion of the rule file that calls the Calibre LFD package, and it must be set off from the rest of the rule file. The LFD::Begin function sets off the Calibre LFD processing block, and the LFD::End function signals the end of the Calibre LFD block.");
MGCAddSnippet(60, "For rapid execution, Calibre LFD enables you to restrict checking to specific layout areas. Creating OPC layers is a time-consuming process, however, with LFD Fast Mode kits only regions of interest are subjected to OPC operations. Regions of interest can be defined by pattern matching, some SVRF statements, or by marking layers.");
MGCAddSnippet(61, "You use the pattern matching Pattern Library Manager GUI and the pattern matching batch utility, pdl_lib_mgr, to create and edit pattern libraries. You use the pattern matching Tcl-based API, pdl_lib_mgr prompt, to edit and traverse pattern libraries and the pattern objects within them.");
MGCAddSnippet(62, "Optional Calibre LFD functions can limit the cells that are checked by the tool. By pre-filtering the cells that are simulated, performance can be improved dramatically.");
MGCAddSnippet(63, "You can use the LFD::LFDRegion command to restrict LFD checking to specific areas in the layout.");
MGCAddSnippet(64, "The Calibre LFD Customizable PV-bands interface provides you with flexibility in generating simulation contours and PV-bands, and the ability to use your custom-generated contours with the Calibre LFD Checks. ");
MGCAddSnippet(65, "You can create contours using the LFD::Contour command. The interface also allows you to use the created contours in creating other contours, PV-bands, or in applying checks to them.");
MGCAddSnippet(66, "You can create any number of PV-bands using the LFD::Band command. A PV-band is defined with two input contours, its minimum PV-band edge, and its maximum PV-band edge. These contours are either original or derived layers, or contour handles generated using the LFD::Contour command.");
MGCAddSnippet(67, "You can create any number of overlay PV-bands using the LFD::OverlayBand command. Overlay PV-bands represent a shifted version of an original PV-band. For example: if band1 consists of the contours {c1 c2 c3}, a shifted version of this PV-band in the north direction consists of {c1_N c2_N c3_N} where c1_N, c2_N and c3_N are the shifted versions of the contour in the north direction.");
MGCAddSnippet(68, "Calibre LFD check options can also be used to perform Calibre LFD checks on specific PV-band or contour handles.");
MGCAddSnippet(69, "The customizable PV-bands functionality is supported in the Calibre LFD Process Design Kit (PDK) flow. Each addPDKLayer call in the PDK defines a layer template, and the information in that template is used in generating OPC output, simulated contours, and checks. You can define contours, PV-bands and overlay PV-bands for each subwindow in the addPDKLayer PvBands section.");
MGCAddSnippet(70, "PV-bands can be obtained in several ways, depending on whether you have a PDK or have an existing PV-band.");
MGCAddSnippet(71, "Certain commands are used when you generate a PV-band without a PDK.");
MGCAddSnippet(72, "You use the LFD::RegisterBands command when you want to reuse a PV-band.");
MGCAddSnippet(73, "Use the LFD::LoadPDK and LFD::RegisterLayer commands to generate PV-bands when you have a PDK.");
MGCAddSnippet(74, "After generating PV-bands, the contours and PV-bands are processed. This can include hotspot checks, scoring, contour output, and model-based extraction. ");
MGCAddSnippet(75, "Several steps are required for writing the rule file to generate PV-Bands. ");
MGCAddSnippet(76, "You generate PV-band data using the LFD::PVband function. ");
MGCAddSnippet(77, "Some basic commands are required for all rule files in Calibre LFD. ");
MGCAddSnippet(78, "To generate PV-band data, you need a minimum of two layers.");
MGCAddSnippet(79, "You issue the LFD::PVband function once for each layer. This one function instructs Calibre LFD to perform all the process variation experiments designed for that layer.");
MGCAddSnippet(80, "Calibre LFD failure rules should identify those areas where variation in printing due to process variation is likely to cause critical errors. The lithographer should provide you with the graphical, mathematical, or verbal descriptions of the rules (checks) you need to write.");
MGCAddSnippet(81, "The built-in check functions provide a quick way to check for the PV-band configurations that are most commonly considered to be problematic. ");
MGCAddSnippet(82, "Writing custom checks allows you to evaluate PV-band data for specific situations or characteristics beyond those provided through the built-in checks. ");
MGCAddSnippet(83, "The lithographer should provide you with a complete description for each of the metrics to be created. You can use standard metrics or custom metrics. ");
MGCAddSnippet(84, "The Calibre LFD software package provides two metrics, Design Variability Index (DVI) and Process Variability Index (PVI).");
MGCAddSnippet(85, "Custom metrics take the form of rulechecks that use the DFM ANALYZE and DFM PROPERTY operations to calculate a score based on statistics for one or more layers. Within the TVF rule file, all code used for preparing data or calculating the scores must be supplied in the form of a VERBATIM block.");
MGCAddSnippet(86, "You must use the LFD::OutputBands command in order to have access to PV-band data for later processing or saving to a database. ");
MGCAddSnippet(87, "If you want to perform additional processing or checking that involves individual contours generated by Calibre LFD, you must first save those contours as derived layers. You do this using the LFD::CaptureContour function.");
MGCAddSnippet(88, "When writing a Calibre LFD rule file, you can generate several types of databases. ");
MGCAddSnippet(89, "The indexing database contain variability scores. You can create as many of these databases as needed. They contain priority rankings for the whole layer.");
MGCAddSnippet(90, "The check database contain two types of data.");
MGCAddSnippet(91, "The bands database contains the actual PV-band structures, stored in ASCII format. You can create as many of these databases as needed, though at the beginning we recommend that you write all PV-bands to the same Bands Database.");
MGCAddSnippet(92, "Many Calibre LFD operations allow you to write Calibre LFD results to a database you specify using the ‑database keyword. This data can include error markers generated by checks as well as PV-band and contour data.");
MGCAddSnippet(93, "The flow for running Calibre LFD with a PDK is essentially the same as running without a PDK: You must write or obtain a rule file for running Calibre LFD, then run Calibre LFD by invoking Calibre from either the command line or the Calibre Interactive GUI. ");
MGCAddSnippet(94, "The PDK includes most of the information you need to run Calibre LFD. ");
MGCAddSnippet(95, "When you obtain a PDK from your foundry or design team, you should also receive a PDK Specification. The PDK Specification provides information you need for working with the PDK. This information is provided in the form of a text file called the PDK Specification. ");
MGCAddSnippet(96, "A limited set of commands are allowed in the PDK. ");
MGCAddSnippet(97, "This topic describes a simple process for writing a control file, which is the TVF rule file used with a PDK. ");
MGCAddSnippet(98, "Macros are functional templates that can be called multiple times in a rule file. They are very useful when writing Calibre LFD rule files. ");
MGCAddSnippet(99, "A macro definition consists of the keyword DMACRO (define macro), followed by a macro name, followed by a list of zero or more argument names, followed by  { , followed by a sequence of zero or more SVRF statements or operations, followed by  } .");
MGCAddSnippet(100, "Layer definition names in DMACRO (define macro) statements are locally-scoped by default when the DMACRO is instantiated in a CMACRO, and references to the layer definition name in the DMACRO are substituted appropriately. If an argument to a DMACRO statement matches the name of a derived layer within the DMACRO block definition, then the corresponding CMACRO argument becomes the name of a global layer.");
MGCAddSnippet(101, "The LOCAL() modifier is used to create local names that are valid only in the scope of each CMACRO call. This modifier is useful for defining specification statements within DMACROs.");
MGCAddSnippet(102, "As a designer, you can incorporate Litho-Friendly Design into your existing flow by adding the Calibre LFD loop.");
MGCAddSnippet(103, "When running Calibre LFD, databases are created that provide information and assist in the evaluation of Calibre LFD run results.");
MGCAddSnippet(104, "The Indexing Database contains variability scores. There may be more than one Indexing Database. They contain priority rankings for the whole layer. ");
MGCAddSnippet(105, "The Check Database contains error markers and priority rankings. ");
MGCAddSnippet(106, "The Bands database contains the actual PV-band structures, stored in ASCII format. There may be more than one Bands Database. ");
MGCAddSnippet(107, "You can run Calibre LFD checks using Calibre Interactive. ");
MGCAddSnippet(108, "You can use Calibre RVE to view each of the results databases from a Calibre LFD run and highlight the results. You can also use DRC HTML Reporting to create a report you can easily share with others. ");
MGCAddSnippet(109, "You can use Calibre RVE to view the Calibre LFD check results. ");
MGCAddSnippet(110, "You can use Calibre RVE to view the Design Variability Index data (DVI) results from a Calibre LFD run. ");
MGCAddSnippet(111, "Once you understand the variability indexes, you can use them to prioritize modifications to the design. As a rule of thumb, the higher the index, the higher the priority.");
MGCAddSnippet(112, "PV-band data (if saved) is saved in the form of an ASCII database called the Bands database. You can view the PV-bands in your layout viewer by opening the Bands database in Calibre RVE and highlighting the individual database objects that represent the PV-bands.");
MGCAddSnippet(113, "DRC HTML reporting in Calibre RVE creates an HTML-formatted report based on views in Calibre RVE for DRC. An HTML report can be created from Calibre LFD output files (RDB and Summary Report) and the layout file. You can include hotspot errors, their properties, as well as snapshots of the hotspots from the layout. You can display results tables, result highlights, histograms, and colormaps.");
MGCAddSnippet(114, "The MBH function of Calibre LFD generates an output file that provides the designer with repair hints on how to modify the layout to fix lithographic hotspot regions.");
MGCAddSnippet(115, "The MBH simulation runs on selected layers of IP design blocks and standard cell geometries. Typical layers for analysis can include active, poly, contact, metal1, and metal2. Multilayer knowledge in conjunction with basic DRC checks such as minimum spacing and width constraints are accounted for during MBH analysis to prevent the hints from introducing new errors. ");
MGCAddSnippet(116, "You can run Calibre LFD with MBH functionality to generate suggested repair hints for the identified lithography hotspots in the layout.");
MGCAddSnippet(117, "This procedure shows you how to view the suggested hotspot fixes from running Calibre LFD with MBH. You display the design database in a layout viewer or editor and use Calibre RVE to view the hint sites.");
MGCAddSnippet(118, "Running Calibre LFD with MBH functionality requires TVF rule and error map (map) files with specific formatting and syntax. Run information is available through the MBH transcript file.");
MGCAddSnippet(119, "The MBH TVF rule file is necessary when running LFD with MBH. This Tcl Verification Format (TVF) file calls the MBH function.");
MGCAddSnippet(120, "The MBH map file, also known as the MBH error map file, defines the layer, check, and interlayer spacing DRC values that are used by MBH generation to produce hints that eliminate hotspots found from a Calibre LFD run.");
MGCAddSnippet(121, "The MBH map file is divided into three sections that define the layer, check, and interlayer DRC values that are used when running LFD with MBH functionality.");
MGCAddSnippet(122, "The MBH transcript file outputs run-specific information that is useful for debugging and reviewing MBH run results.");
MGCAddSnippet(123, "After reviewing the Calibre LFD results and deciding which errors you want to fix first, you can modify the design to correct the problems. Working interactively allows you to re-run Calibre LFD to see how effective your modifications are.");
MGCAddSnippet(124, "Using Calibre Interactive, you can check your design modifications before you commit to them by saving the design. You do this by running the Calibre LFD checks on a selected portion of the layout.");
MGCAddSnippet(125, "The stand-alone rdb_flattener utility provides RDB file flattening functionality from the command line. Typically, this utility is used by designers in the place and route stage of the design flow.");
MGCAddSnippet(126, "As a designer, you can capture process variations and improve design robustness by combining the lithography and edge simulation data from Calibre LFD tools with timing analysis. ");
MGCAddSnippet(127, "The process of combining Litho-Friendly Design (LFD) simulations with timing simulations is referred to as Calibre Model Based Extraction (MBE). ");
MGCAddSnippet(128, "In the typical timing analysis flow, extraction is performed based on the drawn GDS layout.");
MGCAddSnippet(129, "Feeding Calibre LFD contour data forward into timing and power analysis is made possible by the Calibre LFD functions CSG (Contour Simplification for Gates) and CSI (Contour Simplification for Interconnect). These functions translate process variation data into the data that you can feed directly into your extraction tools. ");
MGCAddSnippet(130, "The CSG function generates an output file that fills the gap between Calibre LFD and Calibre nmLVS. The gap exists because LVS tools do not recognize the irregular contours generated by Calibre LFD.");
MGCAddSnippet(131, "To understand how CSG data is fed forward into the extraction tools, you can look at how this data fits into the SPICE model formulas for Leff and Weff. ");
MGCAddSnippet(132, "The output of the CSG function is an ASCII file containing valid SVRF LAYOUT TEXT commands that you include in your Calibre nmLVS run. A properly designed Calibre LFD CSG rule file generates one output file for each poly condition / active condition combination. A results database (RDB) file can also be generated. ");
MGCAddSnippet(133, "The CSI function takes simulated contours for each interconnect layer and breaks them down into component rectangles.");
MGCAddSnippet(134, "The typical timing analysis flow with Model Based Extraction includes Calibre LFD, Calibre nmLVS, and parasitic extraction. ");
MGCAddSnippet(135, "CSI layers and CSG files are two different outputs generated based on Calibre LFD contours. Typically, you create a single rule file that produces both these outputs. When these functions are incorporated into a standard Calibre LFD rule file, you can perform standard Calibre LFD checks at the same time that it generates the simplified contours and the CSG file. ");
MGCAddSnippet(136, "The sample Model Based Extraction rule file produces CSI layers and CSG files. ");
MGCAddSnippet(137, "Calibre LFD includes an extensive set of commands to define and run LFD checks. Most checks produce system-generated properties, scores, and priority values. ");
MGCAddSnippet(138, "Calibre LFD includes commands for performing LFD checks, general purpose commands, and commands for use with PDKs.");
MGCAddSnippet(139, "Calibre LFD outputs system-generated properties for most of the Calibre LFD checks. ");
MGCAddSnippet(140, "Some commands have alternate syntax options if a PDK is used. Some options may be required rather than optional and additional options may be available. ");
MGCAddSnippet(141, "LFD checks look at the interrelationships between PV-bands (or the underlying inner and outer contour layers) or between PV-bands and target features.");
MGCAddSnippet(142, "Registers a user-defined check with the Calibre LFD check registry.");
MGCAddSnippet(143, "Performs custom checks and measurement operations on PVbands using Calibre OPCverify tool syntax.");
MGCAddSnippet(144, "Performs area checks for a specified layer.");
MGCAddSnippet(145, "Checks the size of the predicted overlay between two layers.");
MGCAddSnippet(146, "Checks the endcap enclosure for poly over active.");
MGCAddSnippet(147, "Performs space checks between two separate layers.");
MGCAddSnippet(148, "Checks the distance by which a line-end deviates from the target edge.");
MGCAddSnippet(149, "Performs variability checks on interactions between the two specified layers.");
MGCAddSnippet(150, "Performs variability checks on the change in CD between simulated and drawn features.");
MGCAddSnippet(151, "Performs overlap checks between the two specified layers.");
MGCAddSnippet(152, "Performs an enclosure check between two separate layers where the target layer geometries on the surrounding layer name encloses the geometry on the enclosed layer name.");
MGCAddSnippet(153, "Performs spacing checks for the specified layer.");
MGCAddSnippet(154, "Performs width checks for the specified layer.");
MGCAddSnippet(155, "Finds areas where PV-band and target layer do not interact.");
MGCAddSnippet(156, "Categorizes error markers defined in prior checks into either layout-problem or OPC-problem categories.");
MGCAddSnippet(157, "Performs check on width of a printed via.");
MGCAddSnippet(158, "This reference section contains an alphabetized list of the supported general-purpose Calibre LFD commands.");
MGCAddSnippet(159, "Generates anchor points that are candidates for litho hotspots and problematic patterns.");
MGCAddSnippet(160, "Overrides LFD::Anchor arguments and defines layers and spacing for multi-pattern and multilayer anchor points.");
MGCAddSnippet(161, "Creates PV‑bands with two input contours.");
MGCAddSnippet(162, "Command used to mark the start of the Calibre LFD processing block.");
MGCAddSnippet(163, "Stores a previously generated contour as a derived layer.");
MGCAddSnippet(164, "Configures common user-defined classification options.");
MGCAddSnippet(165, "Creates contours which can be used to create other contours, PV-bands, or to perform checks.");
MGCAddSnippet(166, "Generates a .csg file that can be used as input to Calibre nmLVS.");
MGCAddSnippet(167, "Generates a new layer that is a simplified version of the input contour layer.");
MGCAddSnippet(168, "Generate empirically calibrated PV-bands using Square Directional Kernels (SDK) when access to the exact OPC recipe and models are not available.");
MGCAddSnippet(169, "Command used to signal the end of the Calibre LFD block.");
MGCAddSnippet(170, "Pre-processing that reduces the area to be analyzed by removing those areas that do not require processing by Calibre LFD because they have already been checked or because they are IP that the designer cannot modify.");
MGCAddSnippet(171, "Runs Calibre LFD with MBH and generates a hints file for fixing lithographic hotspots.");
MGCAddSnippet(172, "Extracts layers from the process-correction macro.");
MGCAddSnippet(173, "Returns intermediate OPC layers.");
MGCAddSnippet(174, "Returns OPC layers and visible layers.");
MGCAddSnippet(175, "Returns retarget layers.");
MGCAddSnippet(176, "Returns visible layers.");
MGCAddSnippet(177, "Performs intelligent clipping of one or more input layers based on your marker layers.");
MGCAddSnippet(178, "Defines problem areas based on geometric rules.");
MGCAddSnippet(179, "Defines regions within the layout, which can then be used to limit checking to those areas.");
MGCAddSnippet(180, "Loads the specified PDK and makes it available to Calibre LFD command calls.");
MGCAddSnippet(181, "Defines a macro.");
MGCAddSnippet(182, "Samples and translates features for input to a machine learning training model in the preprocessing and data generation phase of the Calibre LFD deep neural network (DNN) flow.");
MGCAddSnippet(183, "Performs hotspot prediction on a new design using a machine learning trained model in the prediction phase of the Calibre LFD deep neural network (DNN) flow.");
MGCAddSnippet(184, "Writes PV-band data to the specified database.");
MGCAddSnippet(185, "Creates overlay PV-bands with two input contours.");
MGCAddSnippet(186, "Simulates expected lithographic PV-bands in the absence of an RET recipe.");
MGCAddSnippet(187, "Applies a process correction recipe to the specified design layer.");
MGCAddSnippet(188, "Generates PV-band data for the specified layer.");
MGCAddSnippet(189, "Provides layer name for GDS ECO layers.");
MGCAddSnippet(190, "Reads a Cadence Hotspot Interface Format (HIF) file and maps all the polygons from the checks for a given layer onto a single output layer.");
MGCAddSnippet(191, "Reads an iLPC file and maps all the polygons and areas for a given layer onto a single output layer.");
MGCAddSnippet(192, "Reads an RDB file and maps the polygons from the checks for a given layer onto an output layer.");
MGCAddSnippet(193, "Makes PV-band data generated in a previous run available for analysis in the current run.");
MGCAddSnippet(194, "Makes contour data generated in a previous run available for analysis in the current run.");
MGCAddSnippet(195, "Registers a design layer with the Calibre LFD processing engine. ");
MGCAddSnippet(196, "Removes error markers from the output layer of a Calibre LFD check.");
MGCAddSnippet(197, "Sets the Structure Optimizer (STO) mode.");
MGCAddSnippet(198, "Configures the simulations to be performed as part of Calibre LFD.");
MGCAddSnippet(199, "Reduces layout data set being passed into Calibre LFD simulation, improving overall runtime performance. Pattern matching is used to find matches for patterns containing possible lithographic hotspots.");
MGCAddSnippet(200, "Takes hotspot and target layers and creates a pattern description file.");
MGCAddSnippet(201, "Aids checking geometries at top level of the design hierarchy.");
MGCAddSnippet(202, "Generates variability indexes (scores) for the specified layer.");
MGCAddSnippet(203, "Writes a Litho hotspot file that adheres to the Cadence Hotspot Interface Format (HIF).");
MGCAddSnippet(204, "Writes a Litho hotspot file that adheres to the Synopsys IC Compiler format (ICC).");
MGCAddSnippet(205, "A process-specific Calibre LFD kit is the set of rule files and models required for applying Calibre LFD practices to a specific design. A Calibre LFD kit can take the form of either a single file, called a Process Design Kit (PDK), or a set of individual files and directories. PDKs offer the advantages of portability, security, and ease of use. ");
MGCAddSnippet(206, "Creates a check template and assigns it a name by which it can be referenced.");
MGCAddSnippet(207, "Defines a layer process to use when investigating a design.");
MGCAddSnippet(208, "Defines a Structure Optimizer (STO) template and assigns it a name by which it can be referenced.");
MGCAddSnippet(209, "Registers the PDK, setting up the appropriate namespace within Calibre LFD.");
MGCAddSnippet(210, "Calibre LFD uses system-generated names for checks and calculates priorities and scores. ");
MGCAddSnippet(211, "Calibre LFD provides several mechanisms for protecting foundry IP. A basic flow for compiling and encrypting your process data for use by designers is described.");
MGCAddSnippet(212, "Encrypting IP for distribution to customers requires two additional steps for the litho team.");
MGCAddSnippet(213, "Binary optical models are fully functioning model files that protect your IP. When you ship these files as part of your Calibre LFD kit, the designer can run optical simulations but has no visibility to the optical parameters that describe your illumination system. These special optical models work with any command that references an optical model.");
MGCAddSnippet(214, "Resist models and setup files are required for generating PV-bands. To encrypt the resist model, you embed it in the LITHO setup file. Embedding resist models within the LITHO setup file provides maximum IP protection because you can then embed the setup file in the rule file, and encrypt the entire rule file.");
MGCAddSnippet(215, "Encrypting IP for distribution to customers requires three additional steps for the CAD group.");
MGCAddSnippet(216, "Setup files are required for generating PV-bands. To encrypt the setup file, you embed it in the rule file then encrypt the rule file.");
MGCAddSnippet(217, "You can embed the resist model within the LITHO setup file. Embedding resist models within the LITHO setup file provides maximum IP protection because you can then embed the setup file in the rule file and encrypt the rule file. ");
MGCAddSnippet(218, "After embedding your setup files and resist files within the rule files that perform OPC and Calibre LFD, you are ready to encrypt these files and hide your IP. ");
MGCAddSnippet(219, "You can encrypt the complete Calibre LFD rule file.");
MGCAddSnippet(220, "If you are not using a PDK, you also have the option of just encrypting the rule check commands and PV-band generation commands, rather than the complete rule file.");
MGCAddSnippet(221, "You can encrypt the Calibre LFD rules when you are using a PDK. The method used is different than without a PDK.");
MGCAddSnippet(222, "During Calibre LFD kit development, it is recommended that you use the variable CALIBRE_ENCRYPTED_TVF_NO 296578. This simplifies debugging as it runs the byte-compiled package rather than the encrypted package. With the byte-compiled package, full error messages are enabled containing details useful to Calibre LFD kit developers. In addition, the kit developer can use the Calibre -E option to echo SVRF code related to running Calibre LFD to produced files.");
MGCAddSnippet(223, "You provide customers with the encrypted files and the binary optical models when encrypting the Calibre LFD rules. ");
MGCAddSnippet(224, "Using Calibre Interactive, you can launch a Calibre run from your layout viewer/editor and use the current layout as input. This lets you check a correction before you commit to it. ");
MGCAddSnippet(225, "The basic flow for using Calibre Interactive with Calibre LFD includes connecting to a supported design tool and viewing results using Calibre RVE.");
MGCAddSnippet(226, "You can use a runset to save your Calibre Interactive settings for the Calibre LFD run. You can create your own runset or start with an existing runset. ");
MGCAddSnippet(227, "An example rule file and PDK for Calibre LFD are provided.");
MGCAddSnippet(228, "The rule file is written using TVF. The Tcl Verification Format (TVF) is a programmable expansion to the Standard Verification Rule Format (SVRF) language for Calibre. ");
MGCAddSnippet(229, "A typical PDK for Calibre LFD is provided. ");
MGCAddSnippet(230, "There are some specifications often required by the foundry, constraints on the RET recipe decks, as well as general guidelines. ");
MGCAddSnippet(231, "The foundry may have the certain specifications.");
MGCAddSnippet(232, "There are requirements regarding the layer names, models, and SVRF statements used in RET recipe decks for Calibre LFD. ");
MGCAddSnippet(233, "There are some basic guidelines for the layout, models, and rules when performing Calibre LFD. ");
MGCAddSnippet(234, "Calibre RVE is a graphical debug program that provides you with the ability to organize results into histograms, then highlight the results associated with individual histogram bins. The colors used for histograms within Calibre RVE can be matched or defined to colors used for highlights and colormaps in the layout viewer.");
MGCAddSnippet(235, "It is helpful if the colors used for histograms within Calibre RVE match the colors used for highlights and colormaps in the layout viewer. ");
MGCAddSnippet(236, "No special action is needed to match histogram colors to the colors for highlights and colormaps. Calibre RVE handles the color matching automatically.");
MGCAddSnippet(237, "Cadence Virtuoso has a setting to allow color matching and this setting is enabled by default.");
MGCAddSnippet(238, "You can define the layout viewer colors for histograms and highlights with a custom layer properties file.");
MGCAddSnippet(239, "There are Calibre LFD-specific error messages that you may encounter when running Calibre LFD. Some error messages apply to all Calibre LFD checks, while others are check and command specific.");
MGCAddSnippet(240, "Error messages that are common to all checks are often related to invalid name or argument specification.");
MGCAddSnippet(241, "Error messages that are specific to certain commands and checks are often related to invalid name or arguments that are used for the particular check or command.");
MGCAddSnippet(242, "Siemens Digital Industries Software supports an exchange of data between the Calibre Litho-Friendly Design (Calibre LFD) software and Cadence routing tools such as Chip Optimizer (Catena) and NanoRoute.");
MGCAddSnippet(243, "The data flow between Calibre LFD and Cadence tools is done through a set of data exchange files. These files identify the areas of the design that need hotspot correction and limit LFD to the modified areas of the design.");
MGCAddSnippet(244, "You can run Calibre LFD on a design modified with any of the Cadence routing tools. ");
MGCAddSnippet(245, "Pass Calibre LFD results to Cadence tools by generating a data exchange file (or Litho Hot Spots file) in Hotspot Interface Format (HIF). This file identifies those areas requiring correction using the Cadence tools. ");
MGCAddSnippet(246, "The Calibre LFD errmap and rdb2hif command are used to translate hotspot check information to a format used by Cadence tools.");
MGCAddSnippet(247, "The errmap file is an ASCII file that describes the correspondence between a Calibre LFD hotspot check name and Cadence HIF parameters. This file format is also used to describe the correspondence to the Synopsys IC Compiler (ICC) hotspot file. ");
MGCAddSnippet(248, "The stand-alone RDB2HIF command writes a Litho hotspot file that adheres to the Cadence Hotspot Interface Format (HIF). This file passes hotspot data from Calibre LFD to the Cadence tools. The command performs the LFD::WriteHIF functionality from the command line.");
MGCAddSnippet(249, "Siemens Digital Industries Software supports an integration between Calibre Litho-Friendly Design (Calibre LFD) software and the Synopsys IC Compiler (ICC) routing tool. The integration supports automatic detection and fixing of lithographic hotspots.");
MGCAddSnippet(250, "Calibre s RDB format files contain hotspot information for each lithographic weak point, including location, type, and properties. Synopsys  RGF format files contain router fix guidance information, such as hotspot locations and metal avoidance areas.");
MGCAddSnippet(251, "You can run Calibre LFD with the Synopsys routing tools.");
MGCAddSnippet(252, "The Drawn-to-Contour (D2C) flow can be used as a replacement for the LFD::PVband function. The main goal of D2C is to use the LFD::Drawn2Contour function to generate PV-bands when the full OPC recipe and models are not available.");
MGCAddSnippet(253, "D2C replaces the OPC computation and subsequent contour calculation with an edge bias function based on an empirically-calibrated, directional, two-dimensional function. Because the edge bias function does not provide adequate control over the corner locations, a spline-based smoothing process is applied. The outcome is a piecewise-linear curve similar to those obtained by full lithographic simulations.");
MGCAddSnippet(254, "D2C uses the dtcoptimize Calibre WORKbench Tcl command to optimize model and fragment parameters as well as D2C image contour parameters.");
MGCAddSnippet(255, "Calibre WORKbench Tcl command to optimize model and fragment parameters as well as Drawn-to-Contour (D2C) image contour parameters.");
MGCAddSnippet(256, "You can use the printableoptimize Calibre WORKbench Tcl command to optimize a printable model to be used with the LFD::PrintableCheck and LFD::PrintableBand operations. For a newer node, the printability model is compared against a target PV-band while for a mature process it is compared against dose-variation PV-bands.");
MGCAddSnippet(257, "The LFD::PrintableCheck and LFD::PrintableBand operations are used with the printableoptimize Calibre WORKbench Tcl batch command.");
MGCAddSnippet(258, "A Calibre WORKbench Tcl command that performs optimization of printable models to be used with the LFD::PrintableCheck and LFD::PrintableBand operations.");
MGCAddSnippet(259, "You can use Calibre LFD to generate a pattern library for use with the LFD::StructureOptimizer and LFD::RemoveErrors commands.");
MGCAddSnippet(260, "The ability to create a pattern library is a prerequisite for invoking Calibre LFD functionality that uses pattern matching techniques for topology identification. Within the Calibre LFD framework, you can create a rule file that imports a layout design and processes the incoming information to generate a pattern library file.");
MGCAddSnippet(261, "You can use the LFD::StructureOutput command to capture patterns directly from a GDS layout. ");
MGCAddSnippet(262, "Two example command line invocations for the pattern match flow are provided along with a command reference for the pdl_lib_mgr batch command.");
MGCAddSnippet(263, "Batch command that operates on Pattern Matching Database (PMDB) files. The merge option can be used to merge two or more PMDB files, and the prompt option can be used to give you access to pattern matching API functions. The need for merging typically occurs when you are either running multiple databases to generate patterns, or when a preexisting pattern library file needs to be appended to another.");
MGCAddSnippet(264, "The LFD::RemoveErrors operation allows you to remove error markers that have been reported by any Calibre LFD check. A pattern library is used while scanning the results of Calibre LFD to detect any Calibre LFD errors whose context matches that of any pattern stored in the library. If any matches occur, then the underlying error markers are removed from the Calibre LFD check report. ");
MGCAddSnippet(265, "You can use the Calibre LFD deep neural network (DNN) flow to prepare a machine learning model that is trained with available hotspot data for a technology and layer to predict hotspot candidates in new designs with acceptable accuracy.");
MGCAddSnippet(266, "You use machine learning to run the Calibre LFD DNN flow in three phases: preprocessing and data generation, model training, and hotspot prediction.");
MGCAddSnippet(267, "The functionality of the LFD::MLDataGen command is used for preprocessing and data generation in the first phase of the Calibre LFD DNN flow. ");
MGCAddSnippet(268, "A Calibre LFD machine learning DNN training utility is used to perform model training in the second phase of the LFD DNN flow.");
MGCAddSnippet(269, "A Calibre LFD executable utility that uses machine learning to train a raw (untrained) model with the generated CSV file output from the preprocessing and data generation phase of the Calibre LFD DNN flow.");
MGCAddSnippet(270, "The transcript from the model training phase of the Calibre LFD DNN flow contains the training results and run information.");
MGCAddSnippet(271, "The LFD::MLOptimizer command uses the trained output model to perform the hotspot prediction in the third and final phase of the Calibre LFD DNN flow.");
MGCAddSnippet(272, "Certain settings and actions can be used to improve the accuracy of the hotspot predictions in Calibre LFD DNN flow.");
MGCAddSnippet(273, "Details on open source and third-party software that may be included with this product are available in the <your_software_installation_location>/legal directory.");

